const Main=styled.div`
background-color:white;
`
const Header=styled.header`
background-color:black;
display:flex;
flex-direction:row;
align-items:center;
justify content:space-between;
`

function App() {
  return (
    <Main>
      <Header>
        <AppName>
               <img src="/images/food.svg"/>
                <h1>recipe</h1>
        </AppName>
        <SearchName>
               <img src="/images/food.svg"/>
               <input type="text" placeholder="search an item here"></input>
        </SearchName>
      </Header>
    </Main>
  );
}

export default App;
